import styled from 'styled-components';

export const Container = styled.div`
  button {
    display: flex;
    align-items: center;
    justify-content: center;
    background: transparent;
    border: solid 1px #000;
    border-radius: 50%;
    color: #000;
  }
  p {

  }
`;
